'''Ashihama''' is a distant island within the [[Pincers]] region of the [[Wushanko Isles]], otherwise called the Eastern Lands. Little about it is known, though it is most known for being the original home of [[The Nightmare|The Nightmare of Ashihama]], which was created in an ancient ritual by shamans on the island. The Nightmare was eventually driven away from Ashihama by local sirens, led by [[Shura]].

